// 只计算长度
func lengthOfLongestSubstring(str string) int {
	if len([]rune(str)) <= 1 {
		return len([]rune(str))
	}
	current := make(map[rune]int)
	start := 0
	maxLength := 0
	for i, ch := range []rune(str) {
		if last, ok := current[ch]; ok && last >= start {
			start = last + 1
		}
		if i-start+1 > maxLength {
			maxLength = i - start + 1
		}
		current[ch] = i
	}
	return maxLength
}

// 寻找最长不含有重复字符的子串
func allLengthOfLongestSubstring(str string) int {
	if len([]rune(str)) <= 1 {
		return len([]rune(str))
	}
	var subs []string
	var wg sync.WaitGroup
	for i, _ := range []rune(str) {
		wg.Add(1)
		go func(w *sync.WaitGroup, j int) {
			temp, sub := "", ""
			for _, ch := range []rune(str)[j:] {
				r := string(ch)
				temp = fmt.Sprintf("%s%s", sub, r)
				if nonRepeat(temp) {
					// 没有重复字符
					sub = temp
					continue
				} else {
					break
				}
			}
			subs = append(subs, sub)
			w.Done()
		}(&wg, i)
	}
	wg.Wait()
	var result []string
	var length int
	for _, sub := range subs {
		if len(sub) > length {
			length = len(sub)
			result = []string{}
			result = append(result, sub)
		} else if len(sub) == length {
			has := false
			for _, s := range result {
				if s == sub {
					has = true
					break
				}
			}
			if !has {
				result = append(result, sub)
			}
		}
	}
	for _, s := range result {
		fmt.Println(s)
	}
	return length
}

// nonRepeat 判断是否有重复字符
func nonRepeat(str string) bool {
	chars := make(map[int32]int)
	for _, char := range []rune(str) {
		if _, ok := chars[char]; ok {
			return false
		}
		chars[char] = 1
	}
	return true
}
